import React, { useState } from 'react';
import { Form, Button, Alert } from 'react-bootstrap';
import axios from 'axios';

const Rating = ({ role, onRatingUpdate }) => {
  const [reportId, setReportId] = useState(''); // Report ID or Lecture ID
  const [studentId, setStudentId] = useState(''); // Only for lecturers
  const [rating, setRating] = useState('');
  const [comment, setComment] = useState('');
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');
    if (!token) return setError('No authentication token.');

    if (!reportId) return setError(role === 'student' ? 'Please enter Lecture ID.' : 'Please enter Report ID.');

    const payload = {
      rating: parseInt(rating),
      created_at: new Date().toISOString(),
      updated_at: new Date().toISOString(),
    };

    let url = '';

    if (role === 'lecturer') {
      if (!studentId) return setError('Please enter a Student ID.');
      payload.student_id = studentId;
      payload.lecturer_id = localStorage.getItem('userId');
      url = `${process.env.REACT_APP_API_URL}/api/ratings/student/${reportId}`;
    } else if (role === 'student') {
      payload.student_id = localStorage.getItem('userId');
      payload.lecture_id = reportId;
      payload.comment = comment;
      url = `${process.env.REACT_APP_API_URL}/api/ratings/lecture/${reportId}`;
    } else {
      return setError('Invalid role.');
    }

    try {
      await axios.post(url, payload, { headers: { 'x-auth-token': token } });
      setReportId('');
      setStudentId('');
      setRating('');
      setComment('');
      setSuccess('Rating submitted successfully');
      setError(null);
      if (onRatingUpdate) onRatingUpdate();
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to submit rating.');
      setSuccess(null);
    }
  };

  return (
    <div className="mt-3">
      {error && <Alert variant="danger">{error}</Alert>}
      {success && <Alert variant="success">{success}</Alert>}
      <Form onSubmit={handleSubmit}>
        {role === 'lecturer' && (
          <>
            <Form.Group controlId="reportId" className="mb-3">
              <Form.Label>Report ID</Form.Label>
              <Form.Control
                type="text"
                value={reportId}
                onChange={(e) => setReportId(e.target.value)}
                placeholder="Enter Report ID"
                required
              />
            </Form.Group>
            <Form.Group controlId="studentId" className="mb-3">
              <Form.Label>Student ID</Form.Label>
              <Form.Control
                type="text"
                value={studentId}
                onChange={(e) => setStudentId(e.target.value)}
                placeholder="Enter Student ID"
                required
              />
            </Form.Group>
          </>
        )}
        {role === 'student' && (
          <>
            <Form.Group controlId="lectureId" className="mb-3">
              <Form.Label>Lecture ID</Form.Label>
              <Form.Control
                type="text"
                value={reportId}
                onChange={(e) => setReportId(e.target.value)}
                placeholder="Enter Lecture ID"
                required
              />
            </Form.Group>
            <Form.Group controlId="comment" className="mb-3">
              <Form.Label>Comment</Form.Label>
              <Form.Control
                as="textarea"
                rows={3}
                value={comment}
                onChange={(e) => setComment(e.target.value)}
                placeholder="Add your comment here..."
              />
            </Form.Group>
          </>
        )}
        <Form.Group controlId="rating" className="mb-3">
          <Form.Label>Rating (1-5)</Form.Label>
          <Form.Control
            type="number"
            value={rating}
            onChange={(e) => setRating(e.target.value)}
            min="1"
            max="5"
            required
          />
        </Form.Group>
        <Button type="submit">Submit Rating</Button>
      </Form>
    </div>
  );
};

export default Rating;
